#a=test
matrix=[
    [1, 2, 3],
    [4, 5, 6],
    [7, 8, 9]
]
dirs={"R":(1,0),"D":(0,1),"L":(-1,0),"U":(0,-1)}
x,y=1,1
b=[x for x in a.splitlines()]
output=""
for row in b:
    for char in row:
        dx,dy = dirs[char]
        xx,yy = x+dx,y+dy
        xx = xx if 0<=xx<3 else x
        yy = yy if 0<=yy<3 else y
        x,y = xx,yy
    output += str(matrix[y][x])
print(output)

matrix=[
    [0,0,1,0,0],
    [0,2,3,4,0],
    [5,6,7,8,9],
    [0,"A","B","C",0],
    [0,0,"D",0,0],
]
x,y=0,2
b=[x for x in a.splitlines()]
output=""
for row in b:
    for char in row:
        dx,dy = dirs[char]
        xx,yy = x+dx,y+dy
        xx = xx if 0<=xx<5 else x
        yy = yy if 0<=yy<5 else y
        xx = xx if matrix[yy][xx] != 0 else x
        yy = yy if matrix[yy][xx] != 0 else y
        x,y = xx,yy
    output += str(matrix[y][x])
